import React from 'react';
// import './Resume.css';

const Resume = () => {
    return (
        <div className="Resume">
            <text>RESUME PAGE</text>
            <button type="button"><a href="/home">Home</a></button>
            <button type="button"><a href="/about">About</a></button>
            <button type="button"><a href="/projects">Projects</a></button>
            <button type="button"><a href="/art">Art</a></button>
        </div>   
    )
};

export default Resume;
